import { useEffect, useState } from "react";

function PastGames({ socket }) {
    
    const [past, setPast] = useState({});
    const games = [];

    socket.on("pastgames", (past) => {
        console.log(past);
        setPast(past);
    })

    useEffect(() => {
        console.log(past)
        Object.keys(past).forEach((key) => {
            games.push(
                <div>
                    <h2>{key}</h2>
                    {past[key]}
                </div>
            )
        })

    })

    return (
        <div>
            {games.length === 0 ? <h3>No past games</h3> : games}
        </div>
    )
}

export default PastGames;
